// @updateURL https://update.greasyfork.org/scripts/479384/Study%20Bullet%20Skipper.meta.js
// ==/UserScript==

let enrollOnce = false;

function autoEnroll() {
    if (document.querySelector('.enroll_btn') && !enrollOnce) {
        location.assign(document.querySelector('.enroll_btn').href);
        enrollOnce = true;
    }
}

setInterval(autoEnroll, 100);